      string_decoder: "*"
      timers-browserify: "*"
      tty-browserify: "*"
      url: "*"
      util: "*"
      vm-browserify: "*"
  gatsby-plugin-feed@*:
    peerDependencies:
      graphql: "*"
  gatsby@*:
    peerDependencies:
      assert: "*"
      babel-eslint: "*"
      browserify-zlib: "*"
      buffer: "*"
      console-browserify: "*"
      constants-browserify: "*"
      crypto-browserify: "*"
      domain-browser: "*"
      events: "*"
      https-browserify: "*"
      os-browserify: "*"
      path-browserify: "*"
      process: "*"
      punycode: "*"
      querystring-es3: "*"
      stream-browserify: "*"
      stream-http: "*"
      string_decoder: "*"
      timers-browserify: "*"
      tty-browserify: "*"
      typescript: "*"
      url: "*"
      util: "*"
      vm-browserify: "*"
  "@graphql-tools/graphql-tag-pluck@*":
    dependencies:
      "@babel/core": "*"

plugins:
  - path: .yarn/plugins/@yarnpkg/plugin-interactive-tools.cjs
    spec: "@yarnpkg/plugin-interactive-tools"

yarnPath: .yarn/releases/yarn-3.6.0.cjs
